import React from "react";

export default class App extends React.Component {
  constructor() {
    super();
    this.state = {
      continent: "",
      country: "",
      title: "",
      body: "",
    };
  }
  componentDidMount() {
    const connection = new WebSocket("ws://localhost:4000");
  }
  render() {
    return (
      <Router>
        <div className="container">
          <Navigation />
          <Switch>
            <Route path="/about">
              <div>About page here...</div>
            </Route>
            <Route path="/contact">
              <div>Contact page with comment here...</div>
            </Route>
            <Route path="/logs/new" component={CreateLogForm} />
            <Route path="/logs/:logId/edit" component={EditLogForm} />
            <Route path="/logs/:logId" component={Log} />
            <Route path="/">
              <Posts />
            </Route>
          </Switch>
        </div>
        <ToastContainer />
      </Router>
    );
  }
}
